import "../css/price-range.css";

const PriceRange = () => {
    return <div className="container-fluid slider-range">
        <div className="main-slider-range d-flex"></div>
        <div className="slider-range-values d-flex">
            <div className="start-range"></div>
            <div className="range"></div>
            <div className="end-range"></div>

        </div>
    </div>
}

export default PriceRange;
